import React,{Component} from 'react';
import Layout from '../Layout/layout'
import Table from '../components/Table_old/Table';

class Dreans extends Component{
    render(){
        return(
            <Layout>
                <Table/>
            </Layout>
        )
    }
}

export default Dreans;
